import eb from '../src/images/s1.jpg';
import app from '../src/images/s2.jpeg';
import sof from '../src/images/s3.jpeg';
import digi from '../src/images/s4.jpeg'
import ui from '../src/images/s5.jpeg';
import seo from '../src/images/s6.jpeg';

const Sdata = [
    {
        imgsrc: eb,
        title: "Web development"
    },
    {
        imgsrc: app,
        title: "App development"
    },
    {
        imgsrc: sof,
        title: "Software Development"
    },
    {
        imgsrc: digi,
        title: "Digital Marketing"
    },
    {
        imgsrc: ui,
        title: "UI UX Design"
    },
    {
        imgsrc: seo,
        title: "Seo Expert"
    }
]
export default Sdata;
